import React from "react";
import 'bootstrap/dist/css/bootstrap.min.css';
import { useForm } from "react-hook-form";
import { RHFInput } from 'react-hook-form-input';
// import '../styles/main.scss'
import { Form, FormGroup, FormLabel, FormControl, FormText, Container, Row, Col, Button } from "react-bootstrap"

export default () => {
  const { handleSubmit, register, setValue, errors } = useForm();

  const onSubmit = values => {
    console.log(values);
  };

  return (
    <div className="component sixth-component">
      {/* // <Container className="center-block"> */}
      {/* <Grid> */}
      < Col >
        <h1>กรอกข้อมูลคุณดูสิ</h1>
      </Col >
      <Col style={{ justifyContent: 'center', alignItems: 'center', alignContent: 'center', marginHorizontal: '20px', }}>
        <Form style={{ width: '600px' }} className="center-block" onSubmit={handleSubmit(onSubmit)}>
          <FormGroup controlId="formBasicFood" style={{ marginVertical: '20px', }}>
            <Col>ค่าอาหาร</Col>
            <Col>
              <RHFInput
                as={<FormControl style={{ height: '60px' }} type="text" placeholder="ค่าอาหารต่อวัน" />}
                rules={{ required: true }}
                name="inputFood"
                register={register}
                setValue={setValue}
              />
            </Col>
          </FormGroup>
          <FormGroup controlId="formBasicHome">
            <Col>ค่าเช่าบ้าน</Col>
            <Col>
              <RHFInput
                as={<FormControl style={{ height: '60px' }} type="text" placeholder="ค่าเช่าบ้านต่อเดือน" />}
                rules={{ required: true }}
                name="inputHome"
                register={register}
                setValue={setValue}
              />
            </Col>
          </FormGroup>
          <FormGroup controlId="formBasicTransport">
            <Col>ค่าเดินทาง</Col>
            <Col>
              <RHFInput
                as={<FormControl style={{ height: '60px' }} type="text" placeholder="ค่าเดินทางต่อวัน" />}
                rules={{ required: true }}
                name="inputTransport"
                register={register}
                setValue={setValue}
              />
            </Col>
          </FormGroup>
          <FormGroup controlId="formBasicMoney">
            <Col>รายได้</Col>
            <Col>
              <RHFInput
                as={<FormControl style={{ height: '60px' }} type="text" placeholder="เงินเดือน" />}
                rules={{ required: true }}
                name="inputMoney"
                register={register}
                setValue={setValue}
              />
            </Col>
          </FormGroup>
          <Button style={{ height: '60px' }} className="center-block" variant="primary" type="submit">
            คำนวณ
        </Button>
        </Form>
      </Col>
      {/* // </Container > */}
    </div >
  );
};
